import React from 'react';
import ReactDOM from 'react-dom';   

function Clock(){
    return (
        <div>
            <h3>Time: {new Date().toLocaleTimeString()}</h3>
        </div>

    )
}

function tick(){
    ReactDOM.render(<Clock date='' />, document.getElementById('root'));
}

setInterval(tick, 1000);
